    function getDateDiff(s, e) {
      let ms = e.getTime() - s.getTime();
      let days = parseInt(ms / 1000 / 60 / 60 / 24);
      let hours = parseInt(ms / 1000 / 60 / 60 % 24);
      let mins = parseInt(ms / 1000 / 60 % 60);
      let sec = parseInt(ms / 1000 % 60);
      return days + '-' + hours + '-' + mins + '-' + sec;
    }
    // console.log(getAddDayDate(3).join('/'));
    // console.log(getDateDiff(new Date(), new Date('2018-7-13')));
    function int2str(_num) {
