              canvas.style.height = height+"px";
              // _this.ctx.drawImage(canvas, 60, 148, 504, 410);
              let imgdata = canvas.toDataURL("image/jpeg", 0.8);
              // console.log(imgdata);
              _this.$store.commit('changeBase64Img', imgdata);
              let resultImg = new Image();
              resultImg.src = imgdata;
              resultImg.onload = function(){
                  pageloading1.hide();
                  _this.$router.push("/save");
              }
          });

      },0);
      _czc.push(['_trackEvent', 'Shengyucard_pressCard', 'click']);
    }
  }
}
</script>

